css:
.code-search-provider-result-context {
  color: #7d868c;
  font-family: monospace;
  margin-left: 1em;
}
/**
 * Crazy hack to make the highlight row be under the second line instead of
 * the first. We use negative margin in order to shift the element in the flow
 * by one row and use position: relative and negative top to restore it back
 * when it it displayed.
 */
.code-search-provider-result-first-result-for-path {
  margin-top: 25px;
  margin-bottom: -25px;
  position: relative;
  top: -25px;
}
.selected .code-search-provider-result-path {
  color: #7d868c;
}
